import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import { BrowserRouter, Route, Router, Routes } from "react-router-dom"
import Header from './Header';
import Book from './Book';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <Book />
        <Router>
          <Routes>
            <Route path='/' element={<Book/>}></Route>
          </Routes>
        </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
